script: |
  super -f text -I q2514.spq | sort > q2514.out

inputs:
  - name: q2514.spq
    data: |
      SELECT DISTINCT col1 * + col2 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT ( 63 / CAST ( col1 * col0 AS INTEGER ) + + col1 ) <= col0 * 92;
  - name: tab0

outputs:
  - name: q2514.out
    data: |
